Young Justice - Season 2 - Episodes 1 to 10 (DVDRip - 480p)
-----------------------------------------------------------

In season two of this fun and adventurous series from Warner Bros. Animation,
the members of Young Justice continue to test their strengths and fears as
they take on new challenges, battles and secrets, fighting to save the world
from intergalactic bounty hunters and super powered teenage runaways.

Produced by Cartoon Network and Warner Bros. Animation.

